import React from "react";
import { useRouter } from "next/router";

class movie extends React.Component {
  static async getInitialProps({ query }) {
    return { query };
  }

  componentDidMount() {
    console.log(this.props.url.query);
  }

  render() {
    return (
      <div>
        <h1>movie</h1>
      </div>
    );
  }
}

export default movie;
